import styled from "styled-components";

export const StyleCard = styled.div`
  width: 100%;
  height: 800px;
  background-color: var(--background);
  border-radius: 20px;
  opacity: 80%;
  display: flex;
  flex-direction: column;
  align-items: center;
  gap: 10px;
  overflow-y: scroll;
`;
